textDisplay:
@Klim Loginov вы идиот? Смена власти, честные выборы, независимый суд, выборы нового президента и губеров, независимые СМИ, отмена идиотских законов, уменьшение коррупции, люстрация чинуш, проведение реформ:  это все сделает экономику России сильнее и привлекательнее для инвестиций . 
Это знают уже младенцы! 
Гуриева в помощь! И не задавайте больше глупых вопросов!

@Roman Dolmatov 
Для маленьких рек Норильска,21 тысяча тонн солярки,равносильно тоннам нефти в океане.
Посмотрим,сколько заплатит Потанин и  как, это дело замнут,как только шумиха утихнет.

@Виктор Циганов 
1) Никто не должен извиняться за притянутое за уши проявление неуважения. Но Путин должен ответить за парад, на котором будут настоящие, живые ветераны, которые рискуют погибнуть в течение дней после этого.
2) Навальный делает, что хочет, я не кормлю его своими налогами, а пожертвования добровольны. Если вы не согласны, можете попробовать перестать платить налоги с зарплаты и покупок и посмотреть, что получится.

@Roman Dolmatov к слову, моя родная сестра тоже живет в Латинской Америке (Гвадалахара, Мексика). И, знаете, я и не думала, что после постройки моста она все бросит и вернется сюда. Зачем, если там ей лучше? Так что Ваш пример меня совсем не удивил ;)
А про проблемы города я знаю не понаслышке. И, знаете, не все могут/хотят отсюда уехать.
Разве те, кто остается здесь, не имеют права хоть на малейшее улучшение жизни? По типу "не жили богато - нечего и начинать".

@Юлия Мечникова спасибо Юлия.
Желаю искренне Вам здоровья Юлия. Пусть эта зараза пройдёт.
Будьте здоровы

@Фаэтон ))) а зачем у нас надзорные государственные органы, если все делать людям? Я согласна, устроим забастовку, но уволим на хер росприроднадзор и прокуратуру . Что им деньги то платить, если они ничего не делают?? 
Природнадзор— следит за природопользованием, органы прокуратуры осуществляют общий надзор, зачем им платить, если самим все делать? 
Чем вам нравится челябинск, я не знаю, видимо вам нет 40 и у вас еще нет рака.

@Виталий Жениров а виталий! что изменилось за 20 - или как 25 лет и еще продлим это состояние до бесконечности... волонтеры.. рабы бесплатные в конституцию пропишем. на царя волонтерское движение. от 90х. отличает то что теперь все узаконено будет.. люди платят мишустину а в работу волонтерское движение.. в конституцию пропишем - топай гад волонтер тыж подписался.
а зарплаты устраивали всех. и вероятно у вас там 5тый что врятли.. 3 класс может был.
вопрос не в том что было а почему ничего не происходит. одно дерьмо.. придумываются только запрещающие законы - мы выбираем  людей чтоб они запретили мне курить в поликлинике.. я всю жизнь мечтал в поликлинике покурить - а тут хрясь. мною избранный депутат и запретил, получил зарплату, премию. яхту самолет и счатлив и доволен.  глупо говорить  людями которые не изветно чем зарабатывают нет ключика казать про 90е  хорошая жизнь была не пи..  но в телевизоре тебе лажу не сували как хорошо во круг

