@ПРАВОСЛАВНЫЙ МОНАРХИСТ Народники это бандиты.
Все зависиле от царя. Он Думу мог распустить. Парламента нормального в России никогда не было.
Я и не обязан знать, кто меня представляет. Главное, чтобы жилось хорошо, и если плохо, то можно было чиновника поменять. Царь - тоже чиновник, а не богоизбранный.
